--
-- Table structure for table `user`
--

DROP TABLE IF EXISTS `user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Id 主键',
  `type` int(11) NOT NULL COMMENT '用户类型 管理员:0 会员:1 散客:2',
  `openid` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '微信用户唯一ID',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户名',
  `password` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户密码',
  `nick_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户昵称',
  `user_avatar` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户头像',
  `email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '电子邮件',
  `phone` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '手机号',
  `region` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '地区',
  `sex` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '0' COMMENT '性别 默认:0 未知:0 男:1 女:2',
  `birthday` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '生日',
  `reg_ip` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '注册IP',
  `qr_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户二维码',
  `pay_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '付款二维码',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '用户状态 默认:0 正常:1 黑名单-1',
  `follow` int(11) NOT NULL DEFAULT '0' COMMENT '关注状态 未关注:0 已关注:1',
  `log_in_time` datetime DEFAULT NULL COMMENT '最后一次登录时间',
  `create_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '添加用户',
  `create_at` datetime DEFAULT NULL COMMENT '创建时间',
  `update_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '更新用户',
  `update_at` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=113 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='用户表';
/*!40101 SET character_set_client = @saved_cs_client */;

